Guardian of the Republic v01- Enter - The New Marianne (2013) (Digital) (DR &amp; Quinch-Empire)

Promotional info - &quot;He is the last rampart of the Republic against terrorism. For several generations, men of great value have put on the costume of the hero called... The Republican Guard! The Guardian is summoned to free a group of innocent bystanders taken hostage by the notorious criminal cartel, CRIMEN, at the Eiffel Tower. Then, with the help of the fearsome John Mist, and of Alima, a young girl he met during the earlier clash, the Guardian must stop Baroud, the merciless leader of Crimen, from seizing the Louvre Museum in order to acquire a deadly artifact of power - the mask of the legendary Ghorbelep...&quot;

Thanks to D.R. &amp; Qunich-Empire for this digital copy. Please seed and enjoy.

